     Axios.get('https://jsonplaceholder.typicode.com/users')
     .then((response)=>{
        console.log(response);
        console.log(response.data);
        setUsers(response.data)
     })
     .catch(()=>{})
    }
    return <div>
  <h3>User Components</h3>
  <button onClick={getUsers}>GetUsers</button>
